<meta charset="utf-8">
<meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
<title>{{ site.title }}</title>
<meta name="viewport" content="user-scalable=no,initial-scale = 1.0,maximum-scale = 1.0">
<link rel="stylesheet" type="text/css" href="/css/spectrum-core.css" data-spectrum-core>
<link rel="stylesheet" type="text/css" href="" data-spectrum-core-diff>
<link rel="stylesheet" type="text/css" href="/css/spectrum-light.css">
<link rel="stylesheet" type="text/css" href="/css/spectrum-dark.css">
<link rel="stylesheet" type="text/css" href="/css/docs.css">
<link rel="stylesheet" type="text/css" href="/css/pygments.css" data-pygments>
<script src="/css/icons/loadIcons.js"></script>
<script src="/js/docs.js"></script>

{% if jekyll.environment == 'production' %}
<script src="{{ site.launch_library_url_prod }}" async></script>
{% elsif jekyll.environment == 'staging' %}
<script src="{{ site.launch_library_url_stage }}" async></script>
{% else %}
<script src="{{ site.launch_library_url_dev }}" async></script>
{% endif %}
